    <div className="container">
      <div className="row">
        <div className="col-lg-start">
          <br />

          {/* <Card/> */}
          <MyContext.Consumer>
            {}
          </MyContext.Consumer>

          
        </div>

        <div className="col col-lg-2">2 of 2</div>
      </div>
    </div>
  );
};

export default CardDeck;
